import React from "react";
import style from "./BodyBlock.module.css";
import { NavLink } from "react-router-dom";

function BodyBlock() {
  return (
    <div className={style.body}>
      <div className={style.list}>
        <ul>
          <li><NavLink to="" className={style.link}>Normal</NavLink> </li>
          <li><NavLink to="" className={style.link}>Good</NavLink> </li>
          <li><NavLink to="" className={style.link}>Busy</NavLink> </li>
          <li><NavLink to="" className={style.link}>Hot</NavLink> </li>
          <li><NavLink to="" className={style.link}>Upkeep</NavLink> </li>
        </ul>
      </div>
      <div className={style.user}>
          <div className={style.location}>
              <div>
                  <div></div>
              </div>
          </div>
      </div>
    </div>
  );
}

export default BodyBlock;
